import React from 'react';
import './Dropdowns.css';

const Dropdowns = (props) => {
  console.log(props);

   return(
       <div className="dropdown-main-container">
            <select>
              { props.value.map((element, i) =>  
              <option key={i + element.id} 
              onClick={(element) => props.clicked(element)}>{element.value}</option>
    )}
            </select>
       </div>
   )
}

export default Dropdowns;
